import React from 'react'

function TextBox(props) {
    return (
    <div className = "textBox">
        <label htmlFor={props.label + ": "}>{props.label + ": "}</label>

      <input 
        type={"text"} 
        label={props.label} 
        required 
        value={props.value}
        onChange={(e) => props.change(e.target.value)} 
        />
    </div>
  )
}

export default TextBox
